import React, { Component } from 'react'
import "bootstrap/dist/css/bootstrap.min.css";

class CreateWO extends Component{
    constructor(props){
        super(props);
        this.state = {
            w_projectid: '',
            w_WOnum: 0,
            w_desc: '',
            w_status: '',
            w_reporteddate: '',
            w_location: '',
            w_type: '',
            w_TPID: '',
            w_PSProject: '',
            w_PSProjDesc: '',
            w_PSActivity: '',
            w_PSActDesc: '',
        }

        this.onChange = this.onChange.bind(this);
        this.onSubmit = this.onSubmit.bind(this);
    }

    onChange(event){
        this.setState({
            [this.state.event.name] : [this.state.event.target]
        })
    }

    onSubmit(){
        console.log("SUCCESSFULLY SUBMITTED FORM")

        this.setState({
            w_projectid : '',
            w_WOnum: 0,
            w_desc: '',
            w_status: '',
            w_reporteddate: '',
            w_location: '',
            w_type: '',
            w_TPID: '',
            w_PSProject: '',
            w_PSProjDesc: '',
            w_PSActivity: '',
            w_PSActDesc: ''
        })
    }

    render(){
        return(
            <div>
                <h1>HELLO WORLD FROM THE CREATE WORKORDER PAGE</h1>
                <h3>Create New WorkOrder</h3>
                <form onSubmit = {this.onSubmit}>
                    <div className = 'form-group'>
                        <label>Project Id: </label>
                        <input 
                        type = 'text' 
                        className = 'form-control' 
                        name = 'Project Id' 
                        value = {this.state.w_projectid} />
                    </div>
                </form>
            </div>
        )
    }
}

export default CreateWO;
